  flex-direction: column;
`;
const H5 = styled.h5`
  font-size: 15px;
`;

const Project = ({ project }) => {

  return (
    // <Container style={{backgroundImage: `url('${project.img}')`}}>
      <Container>
      {/* <Image src={`${project.img}`}></Image> */}
      <Footer>
        <H5>{project.name}</H5>
        {project.desc}
      </Footer>
    </Container>
  );
};

export default Project;
